import React, {Component} from 'react';
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";

class Navigationbar extends Component {
    render() {

        /* Collapse veya toggle ın rengi değişecek */
        const textStyle = {
            color : "#34a4eb"
        };
        return (
            <div>
                <Navbar bg="dark" expand="lg">
                    <Navbar.Brand href="#home" className="ml-2" style={textStyle}>Alper Tunca</Navbar.Brand>

                    <Navbar.Collapse id="basic-navbar-nav" >
                        <Nav className="ml-auto mr-2" >
                            <Nav.Link href="#home" style={textStyle}>Home</Nav.Link>
                            <Nav.Link href="#projects" style={textStyle}>Projects</Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
            </div>
        );
    }
}

export default Navigationbar;
